import React from 'react'
import { FlatList } from 'react-native'

// Import Components
import SingleStudentItem from '../../components/students/SingleStudentItem'
import ListItemSeparator from '../../components/ListItemSeparator'

// Demo Data
const demoData = [
  {
    id: 1,
    name: 'John Dor',
    degree: 'Engineering',
  },
  {
    id: 2,
    name: 'John Bruce',
    degree: 'Medical',
  },
  {
    id: 3,
    name: 'John Smith',
    degree: 'Engineering',
  },
  {
    id: 4,
    name: 'Bruce Wayne',
    degree: 'Medical',
  },
  {
    id: 5,
    name: 'Kent Clark',
    degree: 'Engineering',
  },
  {
    id: 6,
    name: 'Steve Rogers',
    degree: 'Medical',
  },
  {
    id: 7,
    name: 'Tony Stark',
    degree: 'Engineering',
  },
  {
    id: 8,
    name: 'Berry Allen',
    degree: 'Medical',
  },
]

const StudentsListScreen = () => {
  return (
    <FlatList
      data={demoData}
      keyExtractor={(d) => d.id.toString()}
      renderItem={({ item }) => (
        <SingleStudentItem
          name={item.name}
          degree={item.degree}
          onPress={() =>
            navigation.navigate('StudentDetail', { user_id: item.id })
          }
        />
      )}
      ItemSeparatorComponent={ListItemSeparator}
    />
  )
}

export default StudentsListScreen
